INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (1,1,'陈燮霞','广东',0,'陈燮霞来自八一队，四肢协调且力量均衡，肌肉强健而富有弹性，属于典型的女子力量型身材。2007年首次参加世锦赛，就夺得女子48公斤级抓举、挺举和总成绩三项冠军。2008年奥运会获得48公斤级金牌，这是中国代表团在北京奥运会上夺得的首枚金牌。',,'举重-女子48公斤级','212公斤(95+117)'),
 (2,1,'庞伟','河北',1,'庞伟是近年来涌现的射击新秀，2006年夺得世锦赛男子10米气手枪冠军，开始受到关注。在2008年北京奥运会上夺得男子10米气手枪金牌。',,'射击-男子10米气手枪','688.2环(586+102.2)'),
 (3,2,'郭文珺','陕西',0,'郭文珺1997年10月进入西安市军体校，2005年12月入选陕西省队，2006年9月入选国家队，是中国女子手枪的后起之秀，在2007年先后夺得世界杯德国站的冠军和总决赛亚军。2008年北京奥运会获得女子10米气手枪金牌。',,'射击-女子10米气手枪','492.3环');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (4,2,'郭晶晶,吴敏霞','河北/上海',0,'北京时间8月10日下午14：30，第二十九届奥林匹克运动会跳水项目的比赛在国家游泳中心水立方打响第一炮。在今天下午进行的女子双人三米跳板的决赛中，中国名将郭晶晶和吴敏霞这对黄金组合再次显示出强大的威力，毫无悬念地摘得跳水比赛项目的首金，为中国跳水梦之队开了一个好头。',,'跳水-女子双人3米跳板','343.50分'),
 (5,2,'冼东妹','广东',0,'1988年入选广东省四会市业余体校，1989年进入广东省体校练摔跤，1990年入广东省体校练柔道，1993年入选国家集训队。冼东妹在夺得雅典奥运会金牌后退役，为备战北京奥运会，冼东妹在产后复出，并在北京奥运会上成功卫冕。',,'柔道-女子52公斤级',NULL);
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (6,2,'龙清泉','湖南 ',1,'2008年4月20日，2008年全国男子举重锦标赛暨北京奥运选拔赛在福建省泉州市举行。男子举重全锦赛暨奥运选拔赛56公斤级决赛中，龙清泉爆冷战胜呼声最高的广西名将李争夺冠，让力争北京奥运会该项目金牌的中国举重队又多了一分底气。\r\n在北京奥运会上，龙清泉夺得56公斤级金牌。 ',,'举重-男子56公斤级','292公斤(132+160)'),
 (7,3,'林跃,火亮','北京/上海 ',1,'林跃出自清华跳水队，后加盟北京队。13岁入选国家队，15岁代表中国队参加世锦赛，已经成为田亮、胡佳之后又一位男子跳台新星。\r\n火亮7岁进入体校，开始练体操后转为跳水，9岁进入上海跳水队，是中国跳水队在男子跳台项目上的后起之秀。\r\n林跃和火亮搭档夺得北京2008奥运会男子十米跳台双人金牌。',,'跳水-男子双人10米跳台','468.18分'),
 (8,3,'陈艳青','江苏',0,'1990年在苏州市业余举重训练，教练陈玉芳；1994年调江苏省女子举重队，教练曹新明；1995年进国家举重队，教练曹新明。连续两届夺得2004年和2008年奥运会58公斤级金牌，成为奥运历史上第一个卫冕举重冠军的女选手。',,'举重-女子58公斤级','244公斤(106+138)');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (9,3,'张湘祥','福建',1,'张湘祥是举重老将，在2000年悉尼奥运会就夺得了56公斤级铜牌。由于受伤，张湘祥在2001年九运会后退役，但在2006年复出参加62公斤级，并成功入选北京奥运会阵容。在2008年北京奥运会上，以绝对优势夺得金牌。',,'举重-男子62公斤级','319公斤(143+176)'),
 (10,4,'杨威,黄旭,李小鹏,肖钦,陈一冰,邹凯','湖北/江苏/湖南/江苏/天津/四川',1,'北京时间8月12日，奥运会男子体操团体决赛在体操馆拉开战幕，决赛仍采用6-3-3赛制，中国队的比赛顺序为：自由体操、鞍马、吊环、跳马、双杠、单杠。中国男子体操队一扫上届奥运会失利的阴影，最终中国队以286.125分重新夺回了失去四年的男团冠军！',,'体操-男子团体赛','286.125分');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (11,4,'陈若琳,王鑫','江苏/湖北',0,'北京时间8月12日下午14：30，第二十九届奥林匹克运动会跳水项目的比赛在国家游泳中心水立方又上演了一出精彩的好戏。在今天下午进行的女子双人十米跳台的决赛中，中国队的两员小将王鑫和陈若琳上演女台双飞燕，轻松摘得跳水比赛项目的第三枚金牌，为中国跳水梦之队再传喜讯。这也是中国代表团本届奥运会获得的第11枚金牌。',,'跳水-女子双人10米跳台','363.54分'),
 (12,4,'仲满','江苏',1,'仲满现注册单位为广东，国家队主管教练是张永春。在2008年北京奥运会上一鸣惊人夺得男子佩剑个人赛金牌，成为中国奥运史上第一个男子击剑世界冠军',,'击剑-男子佩剑个人赛',NULL);
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (13,4,'廖辉','湖北',1,'10岁进入仙桃市业余体校开始练习举重，师从举重教练甘永奎。1999年，12岁的廖辉进入湖北省举重青年队。14岁时被送入八一队，2007年年初成绩突飞猛进，入选国家队。\r\n在2008年北京奥运会上夺得69公斤级金牌。 ',,'举重-男子69公斤级','348公斤(158+190)'),
 (14,5,'程菲,邓琳琳,江钰源,何可欣,李珊珊,杨伊琳','湖北/安徽/浙江/北京/湖北/广东',0,'北京时间8月13日中午12点20分，2008年北京奥运会结束了体操女子团体决赛的争夺，中国队以188.90分获得冠军，历史上首次获得了奥运会团体冠军！这是中国代表团奥运史上获得的第五枚团体项目金牌。美国队以186.525分获得亚军，罗马尼亚队181.525分获得季军。',,'体操-女子团体赛','188.900分');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (15,5,'陈颖','北京',0,'北京时间8月13日下午，奥运会女子25米运动手枪决赛结束，我国选手陈颖以793.4环的成绩获得金牌，并打破了决赛奥运会纪录。获得银牌的是蒙古选手贡德格玛，她的成绩是792.2环，获得铜牌的是德国选手蒙赫巴亚尔，成绩是789.2环。另一位中国选手费逢吉名列第四。',,'射击-女子25米运动手枪','793.4环'),
 (16,5,'王峰/秦凯','山东/陕西 ',1,'北京时间8月13日，男子3米双人板决赛将展开争夺，中国组合王峰与秦凯发挥出色，最终以469.08的成绩力压群雄，获得这这枚男子双人板的金牌，取得了跳水梦之队的第四金，这同时是中国军团在本届奥运会上夺得的第16枚金牌。',,'跳水-男子双人3米跳板','469.08分'),
 (17,5,'刘春红','山东',0,'刘春红5破举重世界纪录:\r\n69kg级举重决赛中，我国名将雅典奥运冠军刘春红以抓举128kg、挺举158kg，总成绩286kg夺冠。这名五次打破三项世界纪录的神奇运动员，为中国队又添一金。这也是中国举重队本届奥运会上的第六枚金牌，截至目前这支“梦之队”夺金成功率100%，并且金牌总数已经突破了2004年雅典奥运会。',,'举重-女子69公斤级','286公斤(128+158)');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (18,6,'刘子歌','上海',0,'刘子歌是中国女子蝶泳新秀。1996年，当时7岁的刘子歌正上小学一年级，由于她身材高，身体自然条件好，被刘东挑选进了本溪市体校游泳队，经试训，刘子歌的水感好，游起来特别轻，便把她留在了游泳队，经两年多的训练，她的游泳成绩有明显起色，便将她输送给了沈阳海舰游泳俱乐部，当时约好，刘子歌既代表海舰俱乐部，又代表本溪市体校。2003年至2004年，刘子歌的成绩猛然有所提高，在同组队员中已处于较高水平。后来她又转回到上海市宝山区游泳队。\r\n北京奥运会，刘子歌一鸣惊人，勇夺女子200米蝶泳金牌，并以2:04.72打破世界纪录。 ',,'游泳-女子200米蝶泳','2:04.18'),
 (19,6,'杜丽','山东',0,'1994年开始射击训练，1996年进入山东淄博市体校，1998年进入山东省队，2002年进入国家集训队。\r\n杜丽在2004年雅典奥运会上在8月14日为中国代表团拿下首枚金牌，在2008年北京奥运会8月14日又为中国夺得步枪3x20的金牌。 ',,' 射击-女子50米步枪3x20','690.3环(589+101.3)');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (20,6,'杨威','湖北',1,'杨威动作特点干净利落、节奏好、力量强、空翻高飘。在2006年首次夺得世锦赛男子全能冠军，2007年又以较大优势成功卫冕，成为体操世锦赛81年历史上首位蝉联个人全能冠军的男选手。此外，到2008年北京奥运会为止，杨威已经与队友一起在奥运会和世锦赛上获得了六次团体世界冠军。此外，杨威还夺得了北京奥运会个人全能金牌。',,'体操-男子个人全能','94.575分'),
 (21,6,'张娟娟','山东',0,'张娟娟已经成为中国女子射箭队的领军人物。在2008年北京奥运会上，张娟娟在1/4决赛、半决赛和决赛中连胜三位有着梦之队之称的韩国选手，其中包括卫冕冠军朴成贤、世界纪录保持着尹玉姬，夺得中国射箭史上第一枚奥运金牌。',,' 射箭-女子个人赛',NULL),
 (22,6,'杨秀丽','辽宁',0,'2005年第十届全运会女子-78公斤级亚军；\r\n2006年全国锦标赛-78公斤级冠军；\r\n2006年全国冠军赛-78公斤级冠军；\r\n2008年北京奥运会-78公斤级金牌。 ',,'柔道-女子78公斤级',NULL);
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (23,7,'曹磊','河北',0,'2001年全国锦标赛第一、亚洲锦标赛第一；\r\n2003年亚非运动会第一名，世青赛总成绩、挺举第一，抓举第二；\r\n2004年全国锦标赛女子69公斤级总成绩、挺举、抓举冠军；\r\n2005年十运会第四、东亚运动会69公斤级第一名；\r\n2006世锦赛75公斤级总成绩、挺举第一，抓举第二；\r\n2008年北京奥运会75公斤级金牌。',,'举重-女子75公斤级','282公斤(128+154)'),
 (24,7,'佟文','天津',0,'8月15日这一天是抗日战争胜利63年周年纪念日，而在奥运会赛场，我们的健儿也要与在多个赛场与日本进行直接对话，在这其中，尤为令人关注的是女子柔道78公斤的佟文和即将出场的中国女足。最终佟文没有让国人失望，她让日本人彻底的臣服，不但夺得了自己在奥运会上的首枚金牌，而且实现了自己柔道生涯的“大满贯”，她用场上的实际行动诠释了那句名言——“一切皆有可能”！',,'柔道-女子78公斤以上级  	','一本');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (25,7,'陆永','广西',1,'陆永是中国男子举重在大级别上的后起之秀，在2008年北京奥运会上一鸣惊人，夺得85公斤级金牌，取得中国男子举重在奥运会大级别上的首枚金牌。',,'举重-男子85公斤级','394公斤(180+214)'),
 (26,7,'杜婧,于洋','辽宁/辽宁',0,'北京时间8月15日晚，在北京奥运会羽毛球的一场女子双打决赛中，中国女双于洋/杜婧迎战韩国女双李敬元/李孝贞，最终，于洋/杜婧直落两局，以21-14、21-13，总比分2-0战胜对手，夺得冠军！中国羽毛球成功在奥运会女双的比赛中实现四连冠，这也是中国体育代表团本届奥运会夺得的第26枚金牌。 ',,'羽毛球-女子双打',NULL);
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (27,8,'张宁','辽宁',0,'张宁右手握拍，自1994年就已经开始代表中国出战尤伯杯。张宁是典型的大器晚成型选手，2003年世锦赛才夺得个人首个世界冠军，2004年夺得雅典奥运会女单冠军。\r\n张宁身材高大，打法更富攻击性和杀伤力，自世锦赛和奥运会夺冠后一直保持着世界顶尖水平，排名稳居世界前二。在2008年北京奥运会上卫冕女单冠军。',,'羽毛球-女子单打',NULL),
 (28,9,'邱健','江苏',1,'主攻气步枪的他，在雅典奥运会前，由于状态欠佳错过了参加奥运会的机会。十运会决赛中，他由于发挥失常与金牌失之交臂。\r\n经过几次挫折的邱健，在教练的帮助下逐渐走出了消沉期，并将自己原先的气步枪项目调整为3×40和卧射两个项目。在2008年北京奥运会上，邱健在美国选手埃蒙斯前九枪大比分领先、最后一枪仅4.4环的情况下逆转夺得金牌。 ',,'射击-男子50米步枪3x40','1272.5环(1173+99.5)'),
 (29,9,'唐宾,金紫薇,奚爱华,张杨杨','辽宁/辽宁/山东/辽宁',0,'在北京奥运会上唐宾、金紫薇、奚爱华、张杨杨四人搭档夺得四人双桨金牌，这是中国赛艇在奥运历史上的首枚金牌。 ',,'赛艇-女子四人双桨','6:16.06');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (30,9,'王娇','辽宁',0,'王娇是中国摔跤新秀，年纪轻，上升势头很快，技术尚不够稳定。在2008年北京奥运会上，王娇一路过关斩将，获得72公斤级金牌。其中在半决赛中战胜了日本名将浜口京子，决赛中又击败了两届世锦赛冠军、保加利亚名将兹拉特娃。',,'摔跤/自由式-女子72公斤级',NULL),
 (31,9,'邹凯','四川',1,'2002年2月由四川体操队选入国家队。现为国家体操队主力队员之一，强项是自由体操。在2008年北京奥运会上夺得团体、自由体操两枚金牌。',,'体操-男子自由体操','16.050分'),
 (32,9,'肖钦','江苏',1,'鞍马是中国体操队最有把握夺冠的项目。有“小马神”美誉的世锦赛三连冠得主肖钦拥有世界最高难度动作以及最为优美的流畅动作。\r\n上场后的肖钦异常镇定，与4年前那个腿发软的肖钦相比，他稳定了许多。尽管传说中的托马斯依然没有出现，尽管比赛中他出现了一次分腿小差错，但他动作支撑点高，动作幅度大，韵律好，非常完美。最终，他得到了全场最高的15.875分。  ',,'体操-男子鞍马','15.875分');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (33,9,'张怡宁,王楠,郭跃','北京/辽宁/辽宁',0,'北京奥运会乒乓球女子团体决赛进行，中国队和新加坡队遭遇，前两场单打王楠和张怡宁都是先丢一局的情况下连扳三局击败对手，郭跃/张怡宁搭档在女双直落三局，这样中国女队就以3-0的总比分击败新加坡队夺取冠军，这是中国代表团的第33枚金牌。',,'乒乓球-女子团体',NULL),
 (34,9,'林丹','福建',1,'林丹5岁开始练习羽毛球，9岁进福建体校，12岁入八一队，18岁入选国家队。\r\n林丹左手握拍，以拉吊突击为主打法，进攻意识强，场上速度快，进攻落点好，攻击犀利，步伐灵活，扣杀较具有威胁。2006年世锦赛上击败鲍春来，首次夺得男单世界冠军，2007年世锦赛卫冕冠军头衔。2008年林丹夺得奥运会男子单打金牌。',,'羽毛球-男子单打',NULL);
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (35,9,'郭晶晶','河北',0,'1988年在河北保定训练基地开始跳水训练，教练是李芳。1993年进入河北省跳水队，教练是李芳。1992年入选国家跳水队，教练是于芬，1998年师从钟少珍。\r\n郭晶晶是中国女子跳水队的领军人物，在2004年和2008年包揽了四枚三米板金牌。 ',,'跳水-女子3米跳板','415.35分 '),
 (36,10,'陈一冰','天津',1,'陈一冰1989年开始体操训练，2005年开始在国际比赛中崭露头角，是中国男子体操新生代中的佼佼者，在2006年和2007年的体操世锦赛上，都是中国队获得团体冠军的主力成员。此外，他还在这两届世锦赛上获得了吊环的冠军，在吊环上的优势非常明显。在2008年北京奥运会上夺得团体和吊环金牌。',,'体操-男子吊环','16.600分');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (37,10,'何可欣','北京',0,'中国女子体操新秀，在高低杠上具备顶尖水平，在2008年北京奥运会上夺得女子团体金牌和高低杠金牌。',,'体操-女子高低杠','16.725分'),
 (38,10,'何雯娜','福建',0,'在北京奥运会上，何雯娜在队友黄珊汕失误未进决赛的情况下孤军奋战，夺得女子个人金牌，这是中国选手首次夺得奥运会蹦床金牌。\r\n何雯娜是中国运动员当中空中姿态最为美妙的队员，弹跳出色的她有着从容的时间做自己想做的动作，如果再将难度提高，她必定会创造更多的辉煌战绩。 ',,'体操/蹦床-女子个人赛','37.80分'),
 (39,10,'王励勤,王皓,马琳','上海/吉林/辽宁',1,'王励勤、马琳和王皓，三员虎将帮助中国男乒在决赛中3比0完胜劲敌德国队，夺得了这枚意义非凡的奥运会首枚男子团体金牌。这也是中国乒乓球队本届奥运会继女团后获得的第二枚金牌。',,'乒乓球-男子团体赛',NULL);
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (40,11,'李小鹏','湖南',1,'北京时间8月19日晚6点25分，北京奥运会体操赛场结束了男子体操单项双杠的争夺，我国选手李小鹏以16.450分获得冠军，韩国选手柳源哲以16.250分获得亚军，乌兹别克斯坦选手福金以 16.200分获得第三名。这是李小鹏获得第四枚奥运会金牌，由此追平了伏明霞、邓亚萍、王楠和伏明霞，并列中国获得奥运会金牌最多的运动员。16个世界冠军则刷新了自己刚刚创造的15个世界冠军的纪录。\r\n李小鹏是中国体操“李家军”的第五代接班人。\r\n',,'体操-男子双杠','16.450分'),
 (41,11,'邹凯','四川',1,'2002年2月由四川体操队选入国家队。现为国家体操队主力队员之一，强项是自由体操。在2008年北京奥运会上夺得团体、自由体操两枚金牌。',,'体操-男子单杠','16.200分');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (42,11,'陆春龙','江苏',1,'陆春龙1998年开始训练，2001年参加比赛，是中国男子蹦床的一名后起之秀。在2007年世锦赛上尽管资格赛高居第四，但由于名额所限，未能参加决赛，但其同样具备了争夺金牌的实力。在2008年北京奥运会上，陆春龙夺得男子个人金牌，成为中国首个男子蹦床奥运冠军。',,'体操/蹦床-男子个人赛','41.00分'),
 (43,11,'何冲','广东',1,'6岁开始练跳水，14岁入选国家队。后因为集训效果不理想被国家队退回，2004年重返国家队。在2008年北京奥运会上何冲夺得男子三米板个人金牌。 \r\n',,'跳水-男子3米跳板','572.90分'),
 (44,12,'殷剑','四川',0,'994年进入四川邛海水校，1995年进入四川队；1997年进入国家队代训，2001年正式入选国家队。2008年北京奥运会为中国队夺得首枚帆板奥运金牌(尼尔级)。',,'帆船帆板-女子尼尔级',NULL);
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (45,12,'吴静钰','江西',0,'2006年吴静钰夺得了中国亚运会历史上第一块跆拳道金牌，2007年又成为世锦赛冠军，虽然顶了亚洲冠军和世界冠军两顶帽子，但只有夺得奥运会冠军才能成就真正的王者地位，作为跆拳道界家喻户晓的人物，吴静钰也成为了对手竞相研究的对象。\r\n2008年北京奥运会上，吴静钰一路过关斩将，夺得金牌。 ',,'跆拳道-女子49公斤以下级',''),
 (46,13,'陈若琳','江苏',0,'2008年奥运会单人、双人10米跳台金牌(与王鑫)，跳水世界杯女子单人、双人10米台冠军(与王鑫)，跳水大奖赛深圳站女子单人、双人10米台冠军 (与王鑫)、蒙特利尔站女子单人10米台第四、双人10米台冠军(与王鑫)，跳水系列赛墨西哥站女子单人10米台第三、双人10米台冠军(与王鑫)、南京站女子单人、双人10米台冠军(与王鑫)。',,'跳水-女子10米跳台','447.70分');
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (47,14,'张怡宁','北京',0,'张怡宁6岁开始打球，1991年进入省队，1993年进入国家队，右手横握球拍，两面反胶，弧圈结合快攻打法。张怡宁球风硬朗，打法凶狠，已经取代王楠成为中国女子乒乓球的领军人物。2004年雅典奥运会蝉联女子双打(与王楠)冠军，并夺得女单冠军。2005年夺得第48届世乒赛女单冠军，实现世锦赛、奥运会和世界杯的大满贯。2008年卫冕奥运会女单冠军。',,'乒乓球-女子单打',NULL),
 (48,15,'孟关良,杨文军','浙江/江西',1,'自从出道以来，孟关良便以无可比拟的优势在亚洲多次包揽过男子1000米和500米单人划艇这两个项目的金牌，曾获得八运会、九运会和釜山亚运会1000米和500米单人划艇冠军。2004年和2008年奥运会与杨文军合作夺得了500米双人划艇金牌。\r\n21岁的杨文军来自江西，是中国皮划艇项目上的后起之秀，曾经夺得釜山亚运会男子双人划艇500米、1000米冠军。与名将孟关良合作后，成绩更是突飞猛进，在2004年雅典奥运会上夺得男子双人划艇500米金牌，这是中国选手在皮划艇项目上夺得的首枚奥运金牌。2008年，杨文军与孟关良合作蝉联了这个项目的冠军。',,' 皮划艇/静水-男子双人划艇500米','1:41.025'),
 (49,15,'马琳','辽宁',1,'马琳6岁开始打球，1990年进省市队，1994年进国家队。右手直板反胶快攻结合弧圈型打法，是激情型的选手，打法凶狠，心理状态稳定。曾经三度夺得世界杯男单冠军，成为继孔令辉和刘国梁之后中国男队的绝对主力。其标志性动作就是在比赛中经常旋转自己的球拍。2004年夺得雅典奥运会男双金牌，2008 年获得北京奥运会男子团体、单打金牌。',,'乒乓球-男子单打',NULL);
INSERT INTO `champions_2008` (`abs_index`,`day_index`,`name`,`province`,`sex`,`memo`,`photo`,`item`,`score`) VALUES 
 (50,16,'邹市明','贵州',1,'邹市明16岁进入贵州拳击队，2000年成为国手。进入国家队后，邹市明拿过48公斤级20个全国冠军，是国内在该级别上最有实力的选手。\r\n2005年邹市明在第13届世锦赛上连续击败了雅典奥运会冠军瓦雷拉，欧洲黑马匈牙利选手贝达克，为中国夺得了第一个拳击世锦赛冠军。\r\n2006年多哈亚运会，邹市明再度在这个级别问鼎冠军。\r\n2008年北京奥运会夺得48公斤级金牌，这是中国拳击的首枚奥运金牌。 ',,'拳击-男子48公斤级',NULL),
 (51,16,'张小平','内蒙古',1,'北京时间8月24日下午，北京奥运会最后一天的拳击比赛在工人体育馆进行。在男子轻重量级（81公斤级）决赛中，我国选手张小平以总点数11比7击败了爱尔兰选手肯尼·伊根，为中国代表团夺得本届奥运会的第51枚金牌，肯尼·伊根得到银牌。 ',,'拳击-男子81公斤级',NULL);
